;; **
;;; Converted value for check // see https://www.brewersfriend.com/plato-to-sg-conversion-chart/
;; **

;; @@
(t/table-view (an/with-recipe-csv
	 	  (fn [rows] (->> rows
                   rest
                   (take 500)
                   (filter #(= "Plato" (nth % 16)))
                   (map an/row-to-sg) ;; THIS IS THE ACTUAL CONVERTING FUNCTION
                   (map #(list (nth % 8) (nth % 7)))
                   doall))) :columns ["OG" "FG"])	
