;; @@
(let [data (an/with-recipe-csv 
	   (fn [rows] (->> rows
            	       	rest
        	        	(an/group-by-colums 17)
						(an/map-over-groups #(nth % 4))
						(an/apply-over-groups frequencies)
    	               )))]
  
  	(for [[k v] data]
		(plot/bar-chart (keys v) (vals v) :plot-size 4000))	
  )
